import PropTypes from 'prop-types';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';

function SearchInfo() {
    return (
        <>
            <Box mt={5}>
                <Paper elevation={5}>
                    SearchInfo
                </Paper>
            </Box>
        </>
    );
}



export default SearchInfo;
